        // 메모를 세션 스토리지에 저장
        sessionStorage.setItem('memo', memo);
    };

    return (

        <>
        <div className="sideBar">
            <div className="sideProfile">
                <br/>
                <img id="profileImg" src="img/profileImg.png"/><br/>
                <h4 id="profileText">김동현</h4><br/>
